    address _vault,
    address _distributionPool
  )
  SNXRewardUniLPStrategyWithBuyback(
    _storage,
    fox_weth,
    _vault,
    rewardPoolAddr,
    fox,
    uniswapRouterAddress,
    _distributionPool,
    10000 //buyback ration, 100%
  )
